import Layout from '../components/layout'
import {ArticleCover} from '../components/elements/Article/article-utilities/ArticleCover'
import StoriesEntry from '../components/elements/StoriesEntry/StoriesEntry'
import Link from 'next/link'


function Stories(){
    return (
        <Layout>
            {/* <ArticleCover image="/images"/>     */}
            <StoriesEntry height="h-156" imageWidth="w-192" descriptionWidth="w-108" style="flex justify-start items-center w-full mt-5"/>
        </Layout>
    )
}

export default Stories
